import React from 'react';
import './App.css';

import Nav from './allComponents/nav.component.js';

class App extends React.Component {

  render(){
    var nav1adds = ['/','/micros/','/natives/','/team/'];
    var nav1Tit = ['Home', 'Microgreens', 'Native Plants', 'The Team'];
    var numbers = [1, 2, 3, 4, 5, 6];

    return (
      <div className="App">
        <header className="App-header">

          <Nav adds={nav1adds} titles={nav1Tit} numbers={numbers}/>

          <p>
              This will soon be EUG
          </p>
          <a
            className="App-link"
            href="http://evogrows.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn about EUG
          </a>
        </header>
      </div>
    );
  }
}

export default App;
